import {Link} from "react-router-dom"

export default function Usernvabar() {

    return (
        <div>
          
            (<> <Link to="/"><h1>Home</h1></Link>
            <Link to="/"><h1>score</h1></Link>
            <Link to="/Evaluate"><h1>Work</h1></Link>
            <Link>Login</Link> 

            </>
            )

            
        </div>

    )
}
